import unittest


class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        #  hello, ll will be range(0,5-2+1) = range(0,3) = foreach(0,1,2)
        if len(needle) == 0:
            return 0
        for i in range(0, len(haystack)-len(needle)+1):
            if haystack[i:i+len(needle)] == needle:
                return i
        return -1

    def strStr_slow(self, haystack: str, needle: str) -> int:
        i = j = 0
        if len(needle) == 0:
            return 0
        while i < len(haystack):
            if haystack[i] == needle[j]:
                j += 1
            else:
                i = i-j
                j = 0

            if j == len(needle):
                return i-j+1

            i += 1

        return -1


class TestSolution(unittest.TestCase):
    solution = Solution()

    def test_1(self):
        self.assertEqual(self.solution.strStr("hello", "ll"), 2)

    def test_2(self):
        self.assertEqual(self.solution.strStr("aaaaa", "bba"), -1)

    def test_3(self):
        self.assertEqual(self.solution.strStr("", ""), 0)

    def test_4(self):
        self.assertEqual(self.solution.strStr("", "a"), -1)

    def test_5(self):
        self.assertEqual(self.solution.strStr("a", "a"), 0)

    def test_6(self):
        self.assertEqual(self.solution.strStr("", ""), 39999)


if __name__ == "__main__":
    unittest.main()
